import React from 'react';
import FourYearPlanContent from './FourYearPlanContent';
import Draggable from './../Draggable/Draggable';
import Resume from './../../assets/resume.pdf';
import {Button} from 'antd';
import 'antd/dist/antd.css';
import './FourYearPlan.css';

class Gallery extends React.Component {

    render() {
        return(
          <div className="resume-page-container parallax">
              <h1>Four Year Plan</h1>
              <div className="button-group">
                  <a href={Resume} target="_blank" rel="noopener noreferrer">
                      <Button type="submit" shape="round" icon="download" size="large" ghost="true">
                          Download
                      </Button>
                  </a>
              </div>
              <div className="paper">
                  <FourYearPlanContent/>
              </div>
          </div>
        )
    }
}

export default Gallery
